import { configureStore } from '@reduxjs/toolkit';
import inactiveServicesReducer from '../features/active-user/redux/userServicesSlice'
import inactiveServiceInfoReducer from '../features/active-user/redux/userInactiveServiceSlice'
import servicePlansReducer from '../features/active-user/redux/servicePlansSlice'
import planInfoReducer from '../features/active-user/redux/planInfoSlice'

export const store = configureStore({
  reducer: {
    inactiveServices: inactiveServicesReducer,
    inactiveServiceInfo: inactiveServiceInfoReducer,
    servicePlans: servicePlansReducer,
    selectedPlanInfo: planInfoReducer,
  },
});

export type RootState = ReturnType<typeof store.getState>
export type AppDispatch = typeof store.dispatch
